import React from 'react'
import './jadwal.css'

const jadwal = () => {
  return (
    <div className='spirit__jadwal section__padding' id='jadwal'>
        <div className="spirit__jadwal-heading">
            <h1>JADWAL</h1>
        </div>
        .spirit__jadwal
    </div>
  )
}

export default jadwal
